import React from "react";
import Card from "./Card";
import contacts from "./contacts.js";

function App(){
    for(let i = 0; i < contacts.length; i++){
        return <Card
            name= {contacts[0][i].name}
            image= {contacts[0][i].imageURL}
            tel={contacts[0][i].phone}
            email={contacts[0][i].email}
            />
    }
}

export default App;
